    "en": "Bird's Nest is obtained from the small, edible nests of cave swiftlets which are spun from saliva. They are collected from high up on cave walls and found across South East Asia, notably Thailand, Vietnam, Indonesia and Malaysia. They have been used in Chinese cooking for over 400 years, and are a cornerstone of Chinese food therapy. The nests are first soaked and cleaned to remove debris before being prepared as food or medicine. Containing high levels of calcium, potassium, iron and magnesium, birds nest is used to nourish the skin, improve the appetite, promote a better complexion and tonify lung yin. It is considered beneficial for people with weak lungs and those with chronic coughing, gasping and other related symptoms.\n",
