    "en": "Warm in nature, danggui enters the heart, liver and spleen meridians. It is most useful for enriching and nourishing the blood, activating blood circulation and addressing weaknesses of the heart. Other uses include stopping coughs, treating shortness of breath, moistening the intestines and unblocking the bowels. Danggui treats all types of blood deficiencies and menstrual disorders such as an irregular cycle, painful periods and premenstrual syndrome.\n",
