    "zh-Hans": "玉米穗絲有利尿、镇痛、壓抑發炎细胞和提高能量作用，能夠紓缓排水系统所受的各种刺激，同时亦對小孩的肾脏問題有幫助，當与其他草本同时使用，對治疗排水系统問題如膀胱、尿管道和前列很有幫助。玉米穗絲或有助改善淋病，排水管道黏膜問題和身体水份积存問題。對痛風和風湿均有良效，亦對減低小孩和老人尿床方面有正面结果。此外，玉米穗絲也是一种對身体無害的減肥配方成分。\n"
