    "zh-Hans": "防風属傘形科多年生草本植物，药用部份是根部，是常用的發散風寒药，味甘、辛而药性微溫，歸膀胱、肝、脾经，能發表散風、勝湿止痛、止痙止瀉。传统用于治疗外感風湿引起的感冒、痺痛、肢痙，以及肝郁侮脾的腹痛泄瀉。《本草匯言》中记载：「主諸風周身不遂，骨节酸痛，四肢攣急，痿痺癇痙等症。」\n"
