    "zh-Hant": "防已曬乾後生用，其味苦、辛，藥性寒，為袪風濕、止痛、利水消腫的要藥，對浮腫、關節痺痛等症狀均有良效。容易導致腎衰竭的馬兜鈴科植物廣防己（木防己）現已棄用。\n",
