    "zh-Hans": "本品是参科植物何首烏的塊根，以黑豆汁拌勻，蒸至內外均呈棕褐色再顯干，便成为常用于补血的制何首烏。只经干燥處理者为生首烏。制何首烏味甘、涩，药性微溫，歸肝、肾经，具补益精血、固肾烏鬚的作用，對于一切由于肝肾精血不足而致的症狀，例如脫发白发、头暈目眩、心悸失眠、腰膝酸软、月经不调、性功能問題均有良效。\n"
