    "en": "Fuling, or poria, is a type of fungus that is thinly sliced or diced into blocks. Sweet, bland and neutral in nature, it enters the heart, spleen and kidney meridians. Its primary use is to drain dampness and promote urination, making it a useful treatment for oedema. It also calms the spirit, resolving conditions including insomnia and palpitations.\n",
    "zh-Hant": "茯苓在中藥中屬於利水消腫藥，藥味甘淡，藥性平和，歸心、脾、腎經，能利水滲濕、健脾安神，用於水腫、脾胃虛弱、心悸失眠。茯苓是寄生於松科植物赤松或馬尾松的多孔菌科真菌的菌核，而中心抱有松根者稱為「茯神」，其安神功能較佳。\n",
    "zh-Hans": "茯苓在中药中属于利水消腫药，药味甘淡，药性平和，歸心、脾、肾经，能利水滲湿、健脾安神，用于水腫、脾胃虚弱、心悸失眠。茯苓是寄生于松科植物赤松或馬尾松的多孔菌科真菌的菌核，而中心抱有松根者稱为「茯神」，其安神功能較佳。\n"
