    "zh-Hant": "桑科植物桑是具有藥用價值的植物，其中根皮即中藥桑白皮，味甘而性寒，歸屬肺經，能瀉肺平喘、利水消腫，主治肺熱咳喘，亦用於浮腫等症，《本草綱目》中言：「肺中有水氣及肺火有餘者宜之。」\n",
