    "zh-Hant": "鋸櫚能促進男士排水，減少排水時出現的痛楚，有助紓緩晚上如廁頻密等問題。服用鋸櫚不會引起西藥可能引起的副作用。鋸櫚有助降低在前列組織內 DHT的水平，紓緩前列變大症狀。\n",
