    "en": "Vitamin A helps maintain normal vision in dim light and prevents night blindness and xerophthalmia (dry eyes). It is essential for body growth and necessary for normal bone and tooth development. It also plays a role in the synthesis of protein and glycogen, and is necessary for thyroxine formation, preventing the development of goitres. Retinyl Palmitate is a precursor chemical which the body uses to manufacture vitamin A. Studies show that topically applied retinyl palmitate reverses some aspects of skin ageing. After its absorption into the skin, retinyl palmitate is converted to retinol, and ultimately to retinoic acid (the active form of vitamin A present in Retin-A). Vitamin A is valued for its regenerating properties and is essential for proper formation of the body's tissues. It prevents atrophy in ageing skin and encourages the healthy growth and renewal of skin cells. People lacking in vitamin A frequently suffer from skin problems such as rashes and psoriasis, as well as poor sight.\n",
