    "zh-Hans": "维他命B6在身体中发挥辅酵素(哆醛磷酸盐)的作用。部分维他命B杂是水溶性的，是身心健康的必要元素。维他命B6有助蛋白质、脂肪及碳水化合物的处理和生陈代谢，能平衡女性荷尔蒙，是维持强健免疫系统不可缺少的重要元素。\n"
