    "zh-Hant": "維他命C是組成及維護膠原質的必然要素，它將大量的細胞捆綁在一起，並促進氨基酸中的酪胺酸和色氨酸進行新陳代謝。維他命C對鐵的吸收和活動、脂肪和脂質的新陳代謝、控制血脂、維持牙齒和骨骼健康、毛細管壁及血管健康，以及葉酸的新陳代謝均有幫助。維他命C更是一種強大的抗氧化劑，能中和游離基，保護身體免受與氧化有關的徵狀，包括從皺紋到頑疾等疾病。\n",
    "zh-Hans": "维他命C是组成及维护胶原质的必然要素，它将大量的细胞捆绑在一起，并促进氨基酸中的酪胺酸和色氨酸进行新陈代谢。维他命C对铁的吸收和活动、脂肪和脂质的新陈代谢、控制血脂、维持牙齿和骨骼健康、毛细管壁及血管健康，以及叶酸的新陈代谢均有帮助。维他命C更是一种强大的抗氧化剂，能中和游离基，保护身体免受与氧化有关的徵状，包括从皱纹到顽疾等疾病。\n"
