    "zh-Hans": "维他命P能提升维生素C的功效和或可延长它的效果。由於这个原因维他命 P和维生素C 应该多被一起服用。维他命P有效治疗运动受伤，有助於纾缓痛楚。维他命P同时可以减轻某些症状，包括流血不止和口腔皰疹等。维他命P被认为能保护毛细血管的结构，有抗微生物和促进血液循环的效果。维他命P也负责製造胆汁，控制血液胆固醇水平和防止晶体混浊。\n"
